import React, { useState } from "react";
import { data } from "../Fruits/FruitsData";

import { sellerData } from "../Seller/DataSeller";
export default function Apple() {
  const arr = window.location.href.split("/");
  const named = arr[arr.length - 1].toLowerCase();
  const [loding, setLoding] = useState(false);

  const fruitsDetail = [];
  const [value, setValue] = useState();
  useState(() => {
    async function setInterval() {
      for (let i = 0; i < sellerData.length; i++) {
        let len = sellerData[i].fruits.length;
        for (let j = 0; j < len; j++) {
          // if (sellerData[i].fruits[j].name.includes(named)) {
          //   console.log("fruitsDetail");
          // }
          if (
            sellerData[i].fruits[j].name.toLowerCase().includes("greenapple")
          ) {
            fruitsDetail.push(sellerData[i]);
          }
        }
      }
      console.log(fruitsDetail);
    }
    setInterval();
    setValue(fruitsDetail);
    console.log(value);
    setLoding(true);
  }, []);

  return (
    <>
      <p> {named}</p>

      {loding
        ? value.map((items) => (
            <div className="dealersDisplay">
              <p>{items.name}</p>
              <p>{items.price}</p>
            </div>
          ))
        : "bye"}
    </>
  );
}
